import React from "react"

const Warning = () => {
	return (
		<>
			<h1 style={{ marginTop: "50px" }}>Внимание!</h1>
			<p>Что-то пошло не так, обовите страницу сочетанием клавиш CTRL+Shift+R</p>
			<p>Если контен не прогрузится после нескольких попыток проверьте соединение с интернетом...</p>
		</>
	)
}

export default Warning;
